class ProtocolNotSupportedError extends Error {
    constructor(protocol) {
        super(`Protocol [${protocol}] is an unsupported protocol. Try again with a different protocol.`);
        Object.defineProperty(this, "protocol", {
            enumerable: true,
            configurable: true,
            writable: true,
            value: protocol
        });
        Object.defineProperty(this, "type", {
            enumerable: true,
            configurable: true,
            writable: true,
            value: 'protocol_not_supported'
        });
    }
}

export { ProtocolNotSupportedError };
